(120, 'Request for Replacement of Missing Laptop Screw', '<p>I recently noticed that a screw is missing from my laptop, which may affect its durability and performance. The laptop details are as follows:</p><p><strong>Brand/Model: LENOVO IDEAPAD SLIM 3</strong></p><p>&nbsp;</p><p>I kindly request a replacement screw for my laptop. Please let me know the procedure for obtaining it or if you require any further information.</p><p>&nbsp;</p><p>Looking forward to your prompt response.</p>', '2025-04-03', '2025-04-03', '2025-04-03', 5, 6, 3, 109, '2025-04-03 12:52:32', NULL, NULL, '85,87', 3, 1, 2, 0, NULL, NULL, 'SRN:2025040306523297', NULL),
