(127, '(WiFi) Access to Social Networking Sites', '<p>Greetings, IT Team!<br /><br />We would just like to request assistance on accessing social networking sites when connected to the office WiFi. We understand that they are blocked for privacy and productivity reasons, but our functions as Designer (ecbustamante@carmensbest.com.ph) and Digital Associate (gjtanael@carmensbest.com.ph) require us to be active, monitor, and pull references from socials.<br /><br />Sending here a list of the typical sites we use and need access to for work:<br />1. https://facebook.com<br />2.&nbsp;https://business.facebook.com/<br />3. https://instagram.com/<br />4. https://tiktok.com/<br />5.&nbsp;https://ads.tiktok.com/<br />6.&nbsp;https://business.tiktok.com/<br />7. https://pinterest.com/<br />8.&nbsp;https://behance.net/<br />9. https://stock.adobe.com/<br /><br />Thank you so much! Let me know if you need any additional information.</p>', '2025-04-30', '2025-04-04', '2025-04-04', 4, 6, 2, 123, '2025-04-04 09:56:22', NULL, NULL, '84,85', 3, 3, 2, 0, NULL, NULL, 'SRN:20250404035622104', NULL),
(128, 'MR11 access to all AP and GA users', '<p>Tcode MR11 access to all AP and GA users. We need to generate the GRIR report to make sure that all GR have IR and in order to call PIC attention to submit the invoices they have received.</p><p>&nbsp;</p><p>Thank you.</p>', '2025-04-04', '2025-04-11', '2025-05-07', 1, 6, 3, 111, '2025-04-04 10:17:47', NULL, NULL, '70', 9, 2, 2, 0, NULL, NULL, 'SRN:20250404041747105', '<p>Admin:<br />Thank you for sending us your query. We haven&#39;t heard from you since the last update. We will now close this ticket. If you need to reopen this, kindly create a new ticket.</p>'),
