(209, 'HRIS - Add Function for Offset Leave', '<p>Currently, there is a off set type overtime. But it only save to table ot.<br />FInd a way that you can store the total OT - OFFSET count and use it as leave like the SIL.<br /><br />SIL stores credits in a table. every time the SIL was approved, it gets the available credit count.<br />In OFFSET, it should follow the same logic. Problem is that OFFSET Count is just stored in the OT table.<br /><br />Option 1: Create new table to store all offset OT.<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: Then reuse the save_approve_leave function in pg.<br />Option 2: Modify the OT table&nbsp;<br />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : Then reuse the save_approve_leave function in pg.</p>', '2025-04-22', '2025-04-25', '2025-05-07', 1, 6, 3, 1, '2025-04-22 09:09:42', NULL, NULL, '86', 1, 2, 1, 0, NULL, NULL, 'SRN:20250422030942186', '<p>done added a new offsetstart credit for converted overtime</p>'),
