(265, 'Help Fix Concern in HRIS', '<p>&nbsp;</p><p>HRIS CONCERNS FOR APRIL 30, 2025 PAYROLL - ADJUSTMENT</p><p>1. Monthly rate - Sa Reg Day walang column ng Absent</p><p>- walang deduction of lates</p><p>- Mali computation ng ND (Ramil Arido compared to Recel Daguiwaas)</p><p>2. Daily rate Few employees has credited late/undertime hours pa sa column. Supposedly wala na kasi directly computed na sa basic hours&nbsp;</p><p>3. John Raymond Pasquil Daily rate&nbsp;</p><p>4. John Angelou Salud - Double (Registered)&nbsp;</p><p>5. Jaymar Solayao - Reg day OT nya na 6 hours nasa NDOT (Approved) ng lahat ng column (Also, Jeno Panlaan 2 hours / Armando Baron 8 hours Reg day OT) - done</p><p>6. Samiahan Philamer Same with Jaymar, however, yung sa kanya may Reg OT sya 9 hours (yung 6 hours okay, however yung 3 hours nasa NDOT (Approved) ng lahat ng column&nbsp; - WITH FIX</p><p>7. Jarelton Yap - May Reg day OT (Approved) kahit sakto lang naman 8 hours work (April 16, 2025) - Transferred to Milking Dept. (Approver Irish Joy Camatura) - WITH FIX</p><p>8. Flor Buentipo - Transferred to Pasture Management Dept. (Approver - Arnaldo Dela Cruz) - done</p><p>9. Alan Ladanan &amp; Vellee James Ubanan - Bat may undertime, sakto lang naman 8 hours work</p><p>10. Kent Mark Gotang Bat may Reg Hol ND, duty on day time naman&nbsp;</p><p>11. Victor Sabud - Bat may ND on April 07, 2025&nbsp;</p><p>12. Daniel Sabijon - Bat may ND on April 11, 2025&nbsp;</p><p>13. SIR ALLAN LADANAN NEW APPROVER REPLACEMENT NI SIR PATRICK&nbsp;</p><p>14. List of those who have OT exceeding 8hrs and 5 hrs check if their ot count have less 1 hr bread&nbsp;</p><p>15. tama 9hrs pa rin kay sir alan ladanan/vellee - pero kaya sya nag ka late/undertime. undertime pumasok yung number</p><p>&nbsp;</p>', '2025-05-16', '2025-04-28', '2025-05-13', 4, 6, 3, 86, '2025-05-07 09:22:14', NULL, NULL, '86', 3, 3, 1, 0, NULL, NULL, 'SRN:20250507032214242', '<p>Done Fixing all in the list concern by HR of UHDFI</p>'),
