(410, 'Enhancement for HRIS-TLCI', '<p>add count of employee on restday in (get this in pr_sys_employee_schedule_setup rest_1 and rest_2 where sched_datefrom = today and status_id = 1 - dashboard</p><p>add count of leave(SL, VL, Offset, All Leave) get this in pr_leavefiletb leave_type where leavedate = today and statusid = 1 - dashboard</p><p>&nbsp;</p><p>upper navigation - clock-in/out button flip&nbsp;</p><p>&nbsp;</p><p>window for change approval - HR&nbsp;</p><p>dashboard graph - pie chart for today&#39;s(shift) data&nbsp;</p><p>How many IN&nbsp;</p><p>How many complete the shift</p><p>How many is Absent(no current clock-in)</p><p>&nbsp;</p><p>Birthday in dashboard - list mode</p><p>&nbsp;</p><p>month of regularization - dashboard - list mode</p><p>&nbsp;</p><p>&nbsp;</p><p>change_approver -&gt; new approver should see the previous approver (approved file by subordinate) - approved by get it in logs( tk_ob_logs )&nbsp; - proven right</p><p>&nbsp;</p>', '2025-06-05', '2025-05-27', '2025-06-03', 1, 6, 3, 86, '2025-06-03 11:03:49', NULL, NULL, '86', 3, 3, 1, 0, NULL, NULL, 'SRN:20250603050349387', '<p>Done adding the particular needs&nbsp;</p>'),
(411, 'HRIS-TLCI Part 2 Additional Enhancement', '<p>TLCI HRIS MEETING&nbsp;</p><p>&nbsp;</p><p>FLEXI HOURS = 7AM TO 10PM</p><p>&nbsp;</p><p>CHANGE APPROVER NEED TO UPDATE NEED FIX&nbsp;</p><p>&nbsp;</p><p>OT APPROVER NEED TO FIX</p><p>&nbsp;</p><p>dtr(summary)&nbsp;</p><p>regular holidaw bsc hours = legal holiday bsc hours - same with special holiday bsc hours&nbsp;</p><p>&nbsp;</p><p>STANDARD HOLIDAY NEED TO PUT IN HOLIDAY TABLE - bibigay nila file hr</p><p>&nbsp;</p><p>OFFSET LEAVE ACCUMALATION NEED 2 HOURS FOR FILING</p><p>&nbsp;</p><p>ALL MINIMUM 1 HOURS AND SUCCEDING 30 MINUTES (1) or (.5)</p><p>&nbsp;</p><p>ADDITIONAL LEAVE TYPE -&gt; BIRTH LEAVE = MONTH OF BIRTHDATE CAN BE USED&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>lahat ng Saturday sa tproc regardless of anything make it zero 0</p><p>&nbsp;</p><p>Leave minus of 10 hours = 1.2 example&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>gawa ng account for HR&#39;s</p><p>&nbsp;</p><p>this week need ibigay ang user&#39;s manual ng HRIS today is 06022025</p><p>&nbsp;</p><p>attachement n PMS for 201 - fix&nbsp;</p><p>&nbsp;</p><p>department code hingin kay madam&nbsp;</p><p>&nbsp;</p><p>SECTION SET TO OTHERS&nbsp;</p><p>&nbsp;</p><p>CRUD FOR POSITION UNDER HR SETTINGS&nbsp;</p><p>&nbsp;</p><p>PMS = EMPLOYEE MOVEMENT -&gt; MARK TOPHER VILLALUZ FROM PROBATIONAY OLD INFO TO NEW INFO REGULAR OR END OF CONTRACT SHOULD REFLECT IN HISTORY TAB</p>', '2025-06-13', '2025-06-03', '1900-01-01', 1, 1, 3, 86, '2025-06-03 11:05:06', NULL, NULL, '86', 3, 0, 1, 0, NULL, NULL, 'SRN:20250603050506388', NULL),
