(2304, 800, 271, '2025-08-07 05:06:30', 'UNABLE TO MAKE CALLS AND SEND TEXTS', '@DSINENSE    \\nhi mam , can you do a self troubleshoot for me , upon trying to contact you via call . your number is cannot be reach, 2 reason its either you turned on the Airplane mode or the sim pack is not properly inserted on the sim tray of your cellphone.\\n\\ntroubleshoot guide\\n\\n1. Turn Off the Airplane mode \\n1st go to settings \\n2nd go to connections \\n3rd find the Airplane Mode and toggle on/off\\n\\n\\n2nd. Sim pack is not properly inserted\\n1st removed sim tray \\n2nd check the label on the sim tray \\n3rd Follow the label on the sim tray\\n4th Re-insert the sim tray \\n5th restart the phone .\\n\\nand if it\\\'s still you cannot be send msg and send calls . feel free to reply on this thread . thank you and god bless\\n\\nCC @JFFELIX  ', 'comment', NULL, '', '2025-08-07 05:08:27'),
